import React from 'react';

const CategoryLinks = {
  getLink: (categoryTitle) => {
    const links = {
      "کرم و مرطوب‌کننده": "https://www.digikala.com/personalized-category/moisturizing-cream/",
      "موبر": "https://www.digikala.com/personalized-category/hair-remover-strips/",
      "انرژی‌زا و نوشیدنی": "https://www.digikala.com/personalized-category/sport-energy-drink/",
      "پیرسینگ زنانه و مردانه": "https://www.digikala.com/personalized-category/uni-piercing/",
    };
    return links[categoryTitle] || "#"; // اگر لینک پیدا نشد، به # برمی‌گردد
  },
};

export default CategoryLinks;
